import React from "react";
import "./appointment.css";
import data from './list.json'

export const Appointment =() =>{
    
    const appointments = data.appointments;
    return(

        <div>
            <h1> Appointment list</h1>
            
        <div className="detail">
            {appointments.map((appointments) =>(

             <div className="details" key= {appointments.patient_name}> 
             <h3 className="name">{appointments.patient_name}</h3>
             <p className="mobile_number">{appointments.mobile_number}</p>
             <p className="appointment_date">{appointments.appointment_date}</p>
             <p className="appointment_time">{appointments.appointment_time}</p>
             <p className="doctor">{appointments.doctor}</p>
             <p className="injury">{appointments.injury}</p>

             </div>


            ))}
        </div>
        </div>
   
    )
}
